"use strict";(self.webpackChunkweslley_io=self.webpackChunkweslley_io||[]).push([[6104],{7855:function(e){e.exports=JSON.parse('{"archive":{"blogPosts":[{"id":"/2025/07/19/codecon-summit","metadata":{"permalink":"/en/talks/2025/07/19/codecon-summit","source":"@site/i18n/en/docusaurus-plugin-content-blog-talks/2025/07/19/codecon-summit.mdx","title":"Codecon Summit \u2014 Embrace the Hacker Way","description":"Banner","date":"2025-07-19T00:00:00.000Z","tags":[{"inline":false,"label":"Brazil","permalink":"/en/talks/tags/br","description":"Brazil tag description"},{"inline":false,"label":"PR","permalink":"/en/talks/tags/pr","description":"PR tag description"},{"inline":false,"label":"Curitiba","permalink":"/en/talks/tags/curitiba","description":"Curitiba tag description"}],"readingTime":1,"hasTruncateMarker":true,"authors":[{"name":"Weslley Ara\xfajo","title":"Active open-source contributor, MySQL2\'s co-maintainer and Poku\'s creator \u2728","url":"/","socials":{"linkedin":"https://www.linkedin.com/in/wellwelwel/","github":"https://github.com/wellwelwel","instagram":"https://www.instagram.com/wellwelwel","youtube":"https://youtube.com/@weslleyio"},"imageURL":"/en/img/avatar.png","key":"wellwelwel","page":null}],"frontMatter":{"title":"Codecon Summit \u2014 Embrace the Hacker Way","authors":["wellwelwel"],"tags":["br","pr","curitiba"]},"unlisted":false,"lastUpdatedAt":1751421830000,"nextItem":{"title":"GitHub Brasil \u2014 Open Source Friday","permalink":"/en/talks/2025/03/14/github-brasil"}},"content":"import { Parallax } from \'@site/src/components/Parallax\';\\n\\n<Parallax tiltMaxAngleX={0} perspective={1920}>\\n  ![Banner](./banner.png)\\n</Parallax>\\n\\n\ud83d\udcf9 **Talk:** Creating a Test Runner: What happens behind the tests?\\n\\nThere\'s a lot of talk about testing, but what\'s it like to create a test runner from scratch?<br />\\nMore than that: how do you test a test runner?\\n\\n{/* truncate */}\\n\\nNessa palestra, eu desmonto o Poku, o \xfanico _test runner_ brasileiro para **JavaScript** e **TypeScript**, que desafia mais de 12 anos da hist\xf3ria da linguagem, ao trazer a sintaxe nativa do **JavaScript** para os testes.\\n\\nVoc\xea vai aprender sobre o poder dos subprocessos, isolamento e as vantagens de trabalhar com concorr\xeancia. Tudo isso, usando somente recursos nativos da linguagem.\\n\\nCalma, sintaxe nativa?\\n\\nVoc\xea vai conhecer a hist\xf3ria dos testes para **JavaScript** e o motivo do por que testes n\xe3o seguem o fluxo natural da linguagem, enquanto descobre os bastidores dos _test runners_ mais populares da linguagem.\\n\\nEsse \xe9 o tipo de aprendizado que, independentemente de qual _tester_ voc\xea usa, vai mudar a maneira como voc\xea v\xea os testes de verdade.\\n\\n:::tip\\n\\n**Data da Palestra:** 19 de julho de 2025.<br />\\n**Local:** Viasoft Experience, Curitiba - PR.\\n\\nPrograma\xe7\xe3o completa do evento: [codecon.dev/summit/programacao](https://codecon.dev/summit/programacao).\\n\\n:::"},{"id":"/2025/03/14/github-brasil","metadata":{"permalink":"/en/talks/2025/03/14/github-brasil","source":"@site/i18n/en/docusaurus-plugin-content-blog-talks/2025/03/14/github-brasil.mdx","title":"GitHub Brasil \u2014 Open Source Friday","description":"Banner","date":"2025-03-14T00:00:00.000Z","tags":[{"inline":false,"label":"Brazil","permalink":"/en/talks/tags/br","description":"Brazil tag description"},{"inline":false,"label":"SP","permalink":"/en/talks/tags/sp","description":"SP tag description"},{"inline":false,"label":"S\xe3o Paulo","permalink":"/en/talks/tags/sao-paulo","description":"S\xe3o Paulo tag description"}],"readingTime":0.99,"hasTruncateMarker":true,"authors":[{"name":"Weslley Ara\xfajo","title":"Active open-source contributor, MySQL2\'s co-maintainer and Poku\'s creator \u2728","url":"/","socials":{"linkedin":"https://www.linkedin.com/in/wellwelwel/","github":"https://github.com/wellwelwel","instagram":"https://www.instagram.com/wellwelwel","youtube":"https://youtube.com/@weslleyio"},"imageURL":"/en/img/avatar.png","key":"wellwelwel","page":null}],"frontMatter":{"title":"GitHub Brasil \u2014 Open Source Friday","authors":["wellwelwel"],"tags":["br","sp","sao-paulo"]},"unlisted":false,"lastUpdatedAt":1751421830000,"prevItem":{"title":"Codecon Summit \u2014 Embrace the Hacker Way","permalink":"/en/talks/2025/07/19/codecon-summit"},"nextItem":{"title":"DevFest Cerrado (Google Developer Groups \u2014 GDG)","permalink":"/en/talks/2024/11/23/devfest-cerrado-google-developer-groups"}},"content":"import { Parallax } from \'@site/src/components/Parallax\';\\n\\n<Parallax tiltMaxAngleX={0} perspective={1920}>\\n  ![Banner](./banner.png)\\n</Parallax>\\n\\n\ud83d\udcf9 **Live:** Meeting [**Poku**](https://github.com/wellwelwel/poku).\\n\\n{/* truncate */}\\n\\nEm um bate papo tanto t\xe9cnico, como casual, tive a honra de estrear a primeira edi\xe7\xe3o do **Open Source Friday** da [**GitHub Brasil**](https://www.linkedin.com/company/github-brazil), apresentado pela [**Pachi Parra**](https://www.linkedin.com/in/pachicodes/).\\n\\nAo longo da live, pude contar um pouquinho sobre mim, a import\xe2ncia do _open source_, motiva\xe7\xf5es, desafios e planos futuros para o [Poku](https://github.com/wellwelwel/poku), al\xe9m de contar dicas maravilhosas para quem quer contribuir pela primeira vez, especialmente para quem se sente inseguro.\\n\\nEm 1 hora de live, teve desde conversas, microfone baixo _vs._ alto at\xe9 demais, explica\xe7\xf5es sobre sistemas de m\xf3dulos e a diferen\xe7a de comportamentos entre **Node.js**, **Bun** e **Deno**.\\n\\nTeve at\xe9 _live coding_ mostrando na pr\xe1tica por que outros _test runners_ n\xe3o s\xe3o compat\xedveis em totalidade com todos os executores de **JavaScript** no _backend_ e como o **Poku** desafia mais de 12 anos de hist\xf3ria da linguagem ao trazer o fluxo natural do **JavaScript** para os testes.\\n\\n:::tip\\n\\n[Voc\xea pode reprisar a live no LinkedIn oficial da **GitHub Brasil** \ud83d\udc37](https://www.linkedin.com/events/7305618122546294807/comments/)\\n\\n:::"},{"id":"/2024/11/23/devfest-cerrado-google-developer-groups","metadata":{"permalink":"/en/talks/2024/11/23/devfest-cerrado-google-developer-groups","source":"@site/i18n/en/docusaurus-plugin-content-blog-talks/2024/11/23/devfest-cerrado-google-developer-groups.mdx","title":"DevFest Cerrado (Google Developer Groups \u2014 GDG)","description":"Banner","date":"2024-11-23T00:00:00.000Z","tags":[{"inline":false,"label":"Brazil","permalink":"/en/talks/tags/br","description":"Brazil tag description"},{"inline":false,"label":"GO","permalink":"/en/talks/tags/go","description":"GO tag description"},{"inline":false,"label":"Goi\xe2nia","permalink":"/en/talks/tags/goiania","description":"Goi\xe2nia tag description"}],"readingTime":1.62,"hasTruncateMarker":true,"authors":[{"name":"Weslley Ara\xfajo","title":"Active open-source contributor, MySQL2\'s co-maintainer and Poku\'s creator \u2728","url":"/","socials":{"linkedin":"https://www.linkedin.com/in/wellwelwel/","github":"https://github.com/wellwelwel","instagram":"https://www.instagram.com/wellwelwel","youtube":"https://youtube.com/@weslleyio"},"imageURL":"/en/img/avatar.png","key":"wellwelwel","page":null}],"frontMatter":{"title":"DevFest Cerrado (Google Developer Groups \u2014 GDG)","authors":["wellwelwel"],"tags":["br","go","goiania"]},"unlisted":false,"lastUpdatedAt":1751421830000,"prevItem":{"title":"GitHub Brasil \u2014 Open Source Friday","permalink":"/en/talks/2025/03/14/github-brasil"},"nextItem":{"title":"Microsoft Reactor and NodeBR","permalink":"/en/talks/2024/08/30/microsoft-reactor-e-nodebr"}},"content":"import { Parallax } from \'@site/src/components/Parallax\';\\n\\n<Parallax tiltMaxAngleX={0} perspective={1920}>\\n  ![Banner](./banner.png)\\n</Parallax>\\n\\n\ud83c\udf99\ufe0f **Talk:** Overcoming the impostor syndrome and the challenges of existing in the industry through open-source.\\n\\n{/* truncate */}\\n\\n## \ud83d\udca1 A escolha do tema\\n\\nNesse momento em que muitos programadores se sentem inseguros sobre o futuro da \xe1rea:\\n\\n- Ser\xe1 que o meu n\xedvel \xe9 suficiente?\\n- Eu devo desistir se n\xe3o conseguir um emprego na minha \xe1rea?\\n- Como adquirir experi\xeancias se o mercado n\xe3o me d\xe1 oportunidades?\\n\\nTrazer t\xf3picos sens\xedveis como inseguran\xe7a, complexo de inferioridade e autossabotagem, com uma luz no fim do t\xfanel atrav\xe9s da iniciativa open source, foi bem desafiador, mas muito interessante.\\n\\n## \ud83e\uddd1\ud83c\udffb\u200d\ud83d\udd2c O desenvolvimento\\n\\nEu poderia facilmente explicar o que \xe9 s\xedndrome do impostor e ir direto para a \u201csolu\xe7\xe3o\u201d, mas optei pelo caminho mais dif\xedcil:\\n\\n\u2014 Expor minhas fraquezas durante minha trajet\xf3ria, conversando em um tom pr\xf3ximo ao que seria um desabafo.\\n\\nO intuito era me conectar com quem estivesse ali, evoluir para aprendizado e, quem sabe, inspirar atrav\xe9s da minha hist\xf3ria, compartilhando o lado humano que as redes sociais e os \\"t\xedtulos de LinkedIn\\" n\xe3o mostram.\\n\\n## \ud83d\udc7b Os desafios\\n\\nFalar sobre nossas falhas e inseguran\xe7as para pessoas que nem nos conhecem \xe9 mais complicado do que parece, as pessoas gostam de ouvir algu\xe9m que elas possam admirar.\\n\\nMas os coment\xe1rios e o carinho das pessoas que vieram falar comigo no final, me mostraram que a ideia de me conectar com quem estava ali n\xe3o s\xf3 deu certo, mas que realmente serviu de inspira\xe7\xe3o para algumas pessoas e isso me deixou muito feliz \u2728\\n\\n## \ud83c\udfa4 A palestra\\n\\nFiquei pensativo se as pessoas se interessariam por esse tema, mas aos poucos a sala foi ficando cheia e uma pessoa at\xe9 sentou no ch\xe3o no comecinho.\\n\\nOriginalmente, a apresenta\xe7\xe3o tinha alguns estudos complementares, incluindo telas pr\xe1ticas com contribui\xe7\xf5es open source reais, mas precisei adaptar algumas coisas pra caber no formato e tempo do evento.\\n\\n:::tip\\n\\nSpoiler (GIF) do slide utilizado na palestra:\\n\\n![Banner](./slide.gif)\\n\\n:::"},{"id":"/2024/08/30/microsoft-reactor-e-nodebr","metadata":{"permalink":"/en/talks/2024/08/30/microsoft-reactor-e-nodebr","source":"@site/i18n/en/docusaurus-plugin-content-blog-talks/2024/08/30/microsoft-reactor-e-nodebr.mdx","title":"Microsoft Reactor and NodeBR","description":"Banner","date":"2024-08-30T00:00:00.000Z","tags":[{"inline":false,"label":"Brazil","permalink":"/en/talks/tags/br","description":"Brazil tag description"},{"inline":false,"label":"SP","permalink":"/en/talks/tags/sp","description":"SP tag description"},{"inline":false,"label":"S\xe3o Paulo","permalink":"/en/talks/tags/sao-paulo","description":"S\xe3o Paulo tag description"}],"readingTime":0.52,"hasTruncateMarker":true,"authors":[{"name":"Weslley Ara\xfajo","title":"Active open-source contributor, MySQL2\'s co-maintainer and Poku\'s creator \u2728","url":"/","socials":{"linkedin":"https://www.linkedin.com/in/wellwelwel/","github":"https://github.com/wellwelwel","instagram":"https://www.instagram.com/wellwelwel","youtube":"https://youtube.com/@weslleyio"},"imageURL":"/en/img/avatar.png","key":"wellwelwel","page":null}],"frontMatter":{"title":"Microsoft Reactor and NodeBR","authors":["wellwelwel"],"tags":["br","sp","sao-paulo"]},"unlisted":false,"lastUpdatedAt":1751421830000,"prevItem":{"title":"DevFest Cerrado (Google Developer Groups \u2014 GDG)","permalink":"/en/talks/2024/11/23/devfest-cerrado-google-developer-groups"}},"content":"import { Parallax } from \'@site/src/components/Parallax\';\\n\\n<Parallax tiltMaxAngleX={0} perspective={1920}>\\n  ![Banner](./banner.jpeg)\\n</Parallax>\\n\\n\ud83c\udf99\ufe0f **Talk:** Creating a High-Performance Multi-Platform Test Runner.\\n\\n{/* truncate */}\\n\\nCom o tema \\"API Like a Boss\\", tive a oportunidade de ensinar atrav\xe9s do [**Poku**](https://github.com/wellwelwel/poku).\\n\\nO foco da palestra consistiu na import\xe2ncia de delegar as responsabilidades de cada problema usando recursos nativos do **Node.js**.\\n\\nAo inv\xe9s de apenas falar do Poku em si, tamb\xe9m usei o Poku como uma analogia, ensinando sobre sub-processos e diferen\xe7as entre **Node.js**, **Bun** e **Deno**.\\n\\n:::tip\\n\\n[Veja o slide utilizado na palestra \ud83d\udc37](https://drive.google.com/file/d/16XxIt_pov5aBidGjIwC4V_riYq3PMlrB/view)\\n\\n:::"}]}}')}}]);